import React from "react";
const Login = () => {
  return (
    <div className="container">
      <div className="row mt-5 ms-5" style={{ height: "70vh" }}>
        <div className="col-7 border border-4 mt-3">Full Image</div>
        <div className="col-4 border border-4 mt-3">Actual Form</div>
      </div>
    </div>
  );
};
export default Login;
